class AnnotateMarker {
  constructor(id, unit, centerY, centerX, width, height, type) {
    if (unit === 'percent' && (centerX > 1 || centerY > 1 || width > 1 || height > 1)) {
      throw new Error('AnnotateMarker unit is percent but value > 1');
    }
    this.id = id;
    this.unit = unit;
    this.centerY = centerY;
    this.centerX = centerX;
    this.width = width;
    this.height = height;
    this.type = type;
  }
}
export class MarkerRect extends AnnotateMarker {
  constructor(id, centerY, centerX, width, height, unit = 'percent') {
    const type = 'MarkerRect';
    super(id, unit, centerY, centerX, width, height, type);
  }
}
export class MarkerRound extends AnnotateMarker {
